import React, { useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import Login from './components/Login';
import Register from './components/Register';
import ControlPanel from './components/Dashboard/ControlPanel';
import { SuperAdminProvider, useSuperAdmin } from './SuperAdminContext';
import './App.css';

const SetSuperAdminCredentials = () => {
  const { setSuperAdminCredentials } = useSuperAdmin();

  useEffect(() => {
    const setStaticSuperAdminCredentials = () => {
      const email = 'superadmindefinitivo@gmail.com';
      const password = 'superadmindefinitivo135';
      setSuperAdminCredentials({ email, password });
    };

    setStaticSuperAdminCredentials();
  }, [setSuperAdminCredentials]);

  return null;
};

const App = () => {
  return (
    <SuperAdminProvider>
      <Router>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/control-panel/*" element={<ControlPanel />} />
        </Routes>
      </Router>
    </SuperAdminProvider>
  );
};

export default App;
